static void MainStmHsm_BgnTrans( CarBody *pCarBody, HdStateMachine* pStm, uint64_t targetState ){
    pStm->nTargetState = targetState;
    pStm->nPseudostate = targetState;
    switch( pStm->nCurrentState ){
    case MainTop_MainStm:       MainTop_MainStm_Exit( pCarBody, pStm ); break;
    case MainTop_SubmachineState1:MainTop_SubmachineState1_Exit( pCarBody, pStm ); break;
    case MainTop_S011:          MainTop_S011_Exit( pCarBody, pStm ); break;
    case MainTop_S01:           MainTop_S01_Exit( pCarBody, pStm ); break;
    case MainTop_S03:           MainTop_S03_Exit( pCarBody, pStm ); break;
    case MainTop_S0:            MainTop_S0_Exit( pCarBody, pStm ); break;
    case MainTop_State2:        MainTop_State2_Exit( pCarBody, pStm ); break;
    default: break;
    }
}
static BOOL MainStmHsm_Reset( CarBody* pCarBody, HdStateMachine* pStm, BOOL bUnused, uint64_t nEntryPoint ) {
    if( nEntryPoint != STATE_UNDEF ){
        pStm->nPseudostate = nEntryPoint;
        return FALSE;
    }else{
        pStm->nPseudostate = MainTop_MainStm;
    }
    MainStmHsm_BgnTrans( pCarBody, pStm, pStm->nPseudostate );
    MainStmHsm_EndTrans( pCarBody, pStm );
    return TRUE;
}
static BOOL MainStmHsm_EventProc( CarBody* pCarBody, HdStateMachine* pStm, CarBody_EVENT nEventId, void* pEventParams ){
    BOOL bResult = FALSE;
    pStm->nLCAState = STATE_UNDEF;
    switch( pStm->nCurrentState ){
    case MainTop_MainStm:                       bResult |= MainTop_MainStm_EventProc( pCarBody, pStm, nEventId, pEventParams ); break;
    case MainTop_SubmachineState1:              bResult |= MainTop_SubmachineState1_EventProc( pCarBody, pStm, nEventId, pEventParams ); break;
    case MainTop_S011:                          bResult |= MainTop_S011_EventProc( pCarBody, pStm, nEventId, pEventParams ); break;
    case MainTop_S01:                           bResult |= MainTop_S01_EventProc( pCarBody, pStm, nEventId, pEventParams ); break;
    case MainTop_S03:                           bResult |= MainTop_S03_EventProc( pCarBody, pStm, nEventId, pEventParams ); break;
    case MainTop_S0:                            bResult |= MainTop_S0_EventProc( pCarBody, pStm, nEventId, pEventParams ); break;
    case MainTop_State2:                        bResult |= MainTop_State2_EventProc( pCarBody, pStm, nEventId, pEventParams ); break;
    default: break;
    }
    return bResult;
}
static BOOL MainStmHsm_Abort( CarBody* pCarBody, HdStateMachine* pStm ) {
    pStm->nSourceState = MainTop_MainStm;
    MainStmHsm_BgnTrans( pCarBody, pStm, MainTop_MainStm );
    MainStmHsm_EndTrans( pCarBody, pStm );
    return TRUE;
}
static void MainStmHsm_EndTrans( CarBody *pCarBody, HdStateMachine* pStm ){
    pStm->nCurrentState = pStm->nTargetState;
    pStm->bIsExternTrans = FALSE;
    switch( pStm->nCurrentState ){
    case MainTop_MainStm:       MainTop_MainStm_Entry( pCarBody, pStm ); break;
    case MainTop_SubmachineState1:MainTop_SubmachineState1_Entry( pCarBody, pStm ); break;
    case MainTop_S011:          MainTop_S011_Entry( pCarBody, pStm ); break;
    case MainTop_S01:           MainTop_S01_Entry( pCarBody, pStm ); break;
    case MainTop_S03:           MainTop_S03_Entry( pCarBody, pStm ); break;
    case MainTop_S0:            MainTop_S0_Entry( pCarBody, pStm ); break;
    case MainTop_State2:        MainTop_State2_Entry( pCarBody, pStm ); break;
    default: break;
    }
}
static BOOL MainStmHsm_StateDefaultTrans( CarBody* pCarBody, HdStateMachine* pStm ){
    BOOL bResult = FALSE;
    pStm->nSourceState = pStm->nCurrentState;
    pStm->nLCAState = STATE_UNDEF;
        if( pStm->nCurrentState == MainTop_S0 && pStm->nPseudostate == MainTop_S0_Init  ){
                        if( ( ( MainTop* )pStm->pMain )->ShallowHistoryPseudostate0 != STATE_UNDEF ){
                MainStmHsm_BgnTrans( pCarBody, pStm, ( ( MainTop* )pStm->pMain )->ShallowHistoryPseudostate0 );
                MainStmHsm_EndTrans( pCarBody, pStm );
                bResult = TRUE;
            }else{
                MainStmHsm_BgnTrans( pCarBody, pStm, MainTop_S01 );
                MainStmHsm_EndTrans( pCarBody, pStm );
                bResult = TRUE;
            }
        }else if( pStm->nCurrentState == MainTop_S0 && pStm->nPseudostate == MainTop_S0 
         && ( ( MainTop* )pStm->pMain )->S0Rgn1Hsm.nPseudostate == MainTop_S0Rgn1
         && ( ( MainTop* )pStm->pMain )->S0Rgn2Hsm.nPseudostate == MainTop_S0Rgn2 ){
            MainStmHsm_BgnTrans( pCarBody, pStm, MainTop_MainStm );
            MainStmHsm_EndTrans( pCarBody, pStm );
            bResult = TRUE;
        }else if( pStm->nCurrentState == MainTop_MainStm && pStm->nPseudostate == MainTop_MainStm_Init  ){
                        if (gVar == 0) {
                MainStmHsm_BgnTrans( pCarBody, pStm, MainTop_SubmachineState1 );
                MainStmHsm_EndTrans( pCarBody, pStm );
                bResult = TRUE;
            } else {
                MainStmHsm_BgnTrans( pCarBody, pStm, MainTop_S0 );
                MainStmHsm_EndTrans( pCarBody, pStm );
                bResult = TRUE;
            }
        }else if( pStm->nCurrentState == MainTop_State2 && pStm->nPseudostate == MainTop_State2_Init  ){
            MainStmHsm_BgnTrans( pCarBody, pStm, MainTop_S0 );
            MainStmHsm_EndTrans( pCarBody, pStm );
            bResult = TRUE;
        }else if( pStm->nCurrentState == MainTop_S01 && pStm->nPseudostate == MainTop_InitialPseudostate0  ){
            MainStmHsm_BgnTrans( pCarBody, pStm, MainTop_S011 );
            MainStmHsm_EndTrans( pCarBody, pStm );
            bResult = TRUE;
        }else if( pStm->nCurrentState != pStm->nPseudostate ){
            MainStmHsm_BgnTrans( pCarBody, pStm, pStm->nPseudostate );
            MainStmHsm_EndTrans( pCarBody, pStm );
            bResult = TRUE;
        }else{
        }
    return bResult;
}
static BOOL MainTop_EventProc( CarBody* pCarBody, MainTop* pUsm, CarBody_EVENT nEventId, void* pEventParams ){
    BOOL bResult = FALSE;
    bResult |= S01Rgn1Hsm_EventProc( pCarBody, &pUsm->S01Rgn1Hsm, nEventId, pEventParams );
    bResult |= S02Rgn1Hsm_EventProc( pCarBody, &pUsm->S02Rgn1Hsm, nEventId, pEventParams );
    bResult |= S0Rgn1Hsm_EventProc( pCarBody, &pUsm->S0Rgn1Hsm, nEventId, pEventParams );
    bResult |= SharedTop_EventProc( pCarBody, &pUsm->SubmachineState0Hsm, nEventId, pEventParams ) || S0Rgn2Hsm_EventProc( pCarBody, &pUsm->S0Rgn2Hsm, nEventId, pEventParams );
    bResult |= SharedTop_EventProc( pCarBody, &pUsm->SubmachineState1Hsm, nEventId, pEventParams ) || MainStmHsm_EventProc( pCarBody, &pUsm->MainStmHsm, nEventId, pEventParams );
    return bResult;
}
static BOOL MainTop_StateDefaultTrans( CarBody* pCarBody, MainTop* pUsm ){
    BOOL bResult;
    while( TRUE ){
        bResult = FALSE;
        bResult |= S01Rgn1Hsm_StateDefaultTrans( pCarBody, &pUsm->S01Rgn1Hsm );
        bResult |= S02Rgn1Hsm_StateDefaultTrans( pCarBody, &pUsm->S02Rgn1Hsm );
        bResult |= S0Rgn1Hsm_StateDefaultTrans( pCarBody, &pUsm->S0Rgn1Hsm );
        bResult |= SharedTop_StateDefaultTrans( pCarBody, &pUsm->SubmachineState0Hsm ) || S0Rgn2Hsm_StateDefaultTrans( pCarBody, &pUsm->S0Rgn2Hsm );
        bResult |= SharedTop_StateDefaultTrans( pCarBody, &pUsm->SubmachineState1Hsm ) || MainStmHsm_StateDefaultTrans( pCarBody, &pUsm->MainStmHsm );
        if( bResult == FALSE ){
            break;
        }
    }
    return bResult;
}
static BOOL MainTop_Reset( CarBody* pCarBody, MainTop* pUsm, BOOL lastEnteredStateRecovering, uint64_t entryPt ){
    pUsm->lastEnteredStateRecovering = lastEnteredStateRecovering;
    return MainStmHsm_Reset( pCarBody, &pUsm->MainStmHsm, FALSE, entryPt );
}
static BOOL MainTop_Abort( CarBody* pCarBody, MainTop* pUsm ){
    return MainStmHsm_Abort( pCarBody, &pUsm->MainStmHsm );
}

static void MainTop_Prepare( MainTop* pUsm, HdStateMachine* pParent ){
    pUsm->pParentStm = pParent;
    pUsm->MainStmHsm.pMain = pUsm;
    SharedTop_Prepare( &pUsm->SubmachineState1Hsm, &pUsm->MainStmHsm );
    pUsm->S01Rgn1Hsm.pMain = pUsm;
    pUsm->S0Rgn1Hsm.pMain = pUsm;
    pUsm->S02Rgn1Hsm.pMain = pUsm;
    pUsm->S0Rgn2Hsm.pMain = pUsm;
    SharedTop_Prepare( &pUsm->SubmachineState0Hsm, &pUsm->S0Rgn2Hsm );
}
